  SWIG_Python_SetConstant(d, "fromStart",SWIG_From_int(static_cast< int >(blitz::fromStart)));
  SWIG_Python_SetConstant(d, "toEnd",SWIG_From_int(static_cast< int >(blitz::toEnd)));
